import React from 'react'

const HelloPropsLoopList = (props) =>{
  const listItems = props.data.map((index,text) => {
    return (
      <dt>{index} {text}</dt>
    );
  });

  return (
    <div>
      <dl>
        {listItems}
      </dl>
    </div>
  );
};

export default HelloPropsLoopList;
